// ForecastOverview.jsx
import React from "react";
import { Grid, Typography } from "@mui/material";
import HourlyForecast from "./HourlyForecast"; // Assuming you have HourlyForecast component
import SevenDayForecast from "./SevenDayForecast"; // Assuming you have SevenDayForecast component

function ForecastOverview({ hourlyPredictions, sevenDayPredictions }) {
  return (
    <Grid container spacing={2} style={{ marginTop: "40px" }}>
      <Grid item xs={12}>
        <Typography variant="h5" align="center" style={{ color: "white", marginBottom: "20px" }}>
          Hourly Forecast Prediction
        </Typography>
        <HourlyForecast hourlyPredictions={hourlyPredictions} />
      </Grid>
      <Grid item xs={12}>
        <Typography variant="h5" align="center" style={{ color: "white", marginTop: "40px", marginBottom: "20px" }}>
          7 Days Forecast Prediction
        </Typography>
        <SevenDayForecast predictions={sevenDayPredictions} />
      </Grid>
    </Grid>
  );
}

export default ForecastOverview;
